import React from "react";
import "./Card.css";
export default function index() {
  return (
    <div className="card-wrapper">
      <div className="card-wrapper-parent">
        <div className="card-wrapper1">
          <i
            class="devicon-cplusplus-line-wordmark"
            style={{
              fontSize: 70,
              color: "white",
              padding: 10,
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-javascript-plain"
            style={{
              fontSize: 70,
              color: "white",
              padding: 10,
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-react-original"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-python-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-mysql-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-typescript-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-html5-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-css3-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
        <div className="card-wrapper1">
          <i
            class="devicon-bootstrap-plain"
            style={{
              fontSize: 70,
              color: "white",
            }}
          ></i>
        </div>
      </div>
      <div className="heading">
        <h1>Tools</h1>
        <div>
          <div className="card-wrapper1">
            <i
              class="devicon-linux-plain"
              style={{
                fontSize: 70,
                color: "white",
              }}
            ></i>
          </div>
          <div className="card-wrapper1">
            <i
              class="devicon-vscode-plain"
              style={{
                fontSize: 70,
                color: "white",
              }}
            ></i>
          </div>
        </div>
      </div>
    </div>
  );
}
